export default function VideoFilm({src, id}){
    return (
            <iframe width="100%" height="100%" style={{zIndex: '0'}} id={id} title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>
    )
}
